package com.assignments;

public class Swapping {
	public static void swap(int a,int b) {
		int temp;
		temp=a;
		a=b;
		b=temp;
		System.out.println(a);
		System.out.println(b);
	}

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		swap(10,20);

	}

}
